import React from "react";
import { Link } from "react-router-dom";
import { NavWrapper, NavContents, StyledLink } from "./NavStyles";

const Nav = () => {
    function changeColor(e) {
        e.target.style.color = 'red';
      }

  return (
    <NavWrapper>
      <NavContents>
        <Link
          to={"/"}
          style={{
            color: "hotpink",
            textDecoration: "none",
            textAlign: "center",
          }}
        >
          {" "}
          Home{" "}
        </Link>

        <Link
          to={"/interview"}
          style={{
            color: "hotpink",
            textDecoration: "none",
            textAlign: "center",
          }} onMouseOver={changeColor}
          onMouseLeave={false}
        >
          {" "}
          Interview{" "}
        </Link>

        <Link
          to={"/projects"}
          style={{
            color: "hotpink",
            textDecoration: "none",
            textAlign: "center",
          }}
        >
          {" "}
          Projects{" "}
        </Link>

        <Link
          to={"/contact"}
          style={{
            color: "hotpink",
            textDecoration: "none",
            textAlign: "center",
          }}
        >
          {" "}
          Contact{" "}
        </Link>

        <header>
          <p>Nav</p>
        </header>
      </NavContents>
    </NavWrapper>
  );
};

export default Nav;
